import React from "react";
import {
  Card,
  CardContent,
  Typography,
  Avatar,
  Grid,
  Button,
} from "@mui/material";
import { styled } from "@mui/system";

const ProfileCard = styled(Card)({
  maxWidth: 600,
  margin: "auto",
  marginTop: "50px",
  textAlign: "center",
  padding: "20px",
});

const ProfileAvatar = styled(Avatar)({
  width: 100,
  height: 100,
  margin: "auto",
  marginBottom: "20px",
});

const ProfilePage = () => {
  return (
    <ProfileCard>
      <ProfileAvatar
        src="https://via.placeholder.com/100"
        alt="Mohamed Kaanoun"
      />
      <CardContent>
        <Typography variant="h5">Mohamed Kaanoun</Typography>
        <Typography variant="body2" color="textSecondary">
          Admin
        </Typography>
        <Typography variant="body1" sx={{ marginTop: "20px" }}>
          Email: mohamedkaanoun@example.com
        </Typography>
        <Typography variant="body1">Phone: +1234567890</Typography>
        <Typography variant="body1">
          Address: 123 Admin Street, Admin City, Country
        </Typography>
        <Grid
          container
          spacing={2}
          justifyContent="center"
          sx={{ marginTop: "20px" }}
        >
          <Grid item>
            <Button variant="contained" color="primary">
              Edit Profile
            </Button>
          </Grid>
          <Grid item>
            <Button variant="outlined" color="secondary">
              Change Password
            </Button>
          </Grid>
        </Grid>
      </CardContent>
    </ProfileCard>
  );
};

export default ProfilePage;
